            Debug.Log("All OK");
            Debug.Log("Status Code: " + request.responseCode);
            //var respuesta = JsonUtility.FromJson<>(request.downloadHandler.text);

            schedule = JsonConvert.DeserializeObject<Schedule[]>(respuesta);

            days = new List<PointOfInterest>[schedule.Length];

            for (int i = 0; i < schedule.Length; i++)
            {
                days[i] = new List<PointOfInterest>();

                for (int j = 0; j < schedule[i].tour.Length; j++)
                {
                    poi = JsonConvert.DeserializeObject<PointOfInterest>(schedule[i].tour[j].ToString());
                    if (poi.type == "poi")
                    {
                        if(poi.opening_hours != null)
                        {

                            try
                            {
                                poi.open_hours = JsonConvert.DeserializeObject<OpenHour>(poi.opening_hours.ToString());
                            }
                            catch (System.Exception)
                            {
                                poi.open_hours = new OpenHour();
                            }

                            if (poi.open_hours.periods != null && poi.open_hours.periods.Length > 0)
                            {
                                for(int k = 0; k < poi.open_hours.periods.Length; k++)
                                {
                                    try
                                    {
                                        poi.open_hours.periods[k].open = poi.open_hours.periods[k].open.Insert(2, ":");
                                        poi.open_hours.periods[k].close = poi.open_hours.periods[k].close.Insert(2, ":");
                                    }
                                    catch (System.Exception)
                                    {
                                        poi.open_hours.periods[k] = new Period();
                                    }
                                    
                                }
                            }
                        }

                        splitIcon = poi.icon.Split('/');
                        splitIcon = splitIcon[splitIcon.Length - 1].Split('-');

                        if(splitIcon[0] == "generic_business")
                        {
                            poi.typePOI = findTypeByName(poi.name);
                        }
                        else
                        {
                            poi.typePOI = formatType(splitIcon[0]);
                        }
                        

                        days[i].Add(poi);
                    }
                }
            }

            if(days != null && days.Length != 0)
            {
                variables.days = days;
                SceneManager.LoadScene("Scene1");
            }
            else
            {
                PlayerPrefs.SetString("errorDatosServicio", "The requested information could not be generated, try again");
                SceneManager.LoadScene("SceneForm");
            }
        }
