    private string findTypeByName(string name)
    {
        name = name.ToLower();
        string[] words = name.Split(' ');

        for(int i = 0; i < words.Length; i++)
        {
            switch (words[i])
            {
                case "museo":
                    return "Museum";
                case "restaurante":
                    return "Restaurant";
                case "acuario":
                    return "Aquarium";
                case "cementerio":
                    return "Cementery";
                case "mesquita":
                    return "Mosque";
                case "galeria de arte":
                    return "Museum";
                case "estadio":
                    return "Stadium";
                case "iglesia":
                    return "Church";
                case "parque de atracciones":
                    return "Park";
                case "templo hindu":
                    return "Hindu Temple";
                case "zoologico":
                    return "Zoo";
                case "parque":
                    return "Park";
            }
        }
        
        return "Default";
    }

    private string formatType(string type)
    {

        switch (type)
        {
            case "museum":
                return "Museum";
            case "shopping":
                return "Shopping";
            case "cementery_grave":
                return "Cementery";
            case "worship_islam":
                return "Mosque";
            case "stadium":
                return "Stadium";
            case "worship_general":
                return "Church";
            case "park":
                return "Park";
            case "worship_hindu":
                return "Hindu Temple";

            default:
                return "Default";
        }
    }


